script: |
  super -f text -I q10603.spq | sort > q10603.out

inputs:
  - name: q10603.spq
    data: |
      SELECT DISTINCT - col2, - 11 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - - col0 IS NULL;
  - name: tab0

outputs:
  - name: q10603.out
    data: |
      -10	-11
      -47	-11
      -99	-11
